import React, {Component} from 'react'

class Login extends Component {
  render() {
      return (
          <body>
            <div>
                Reni

            </div>
            <style jsx>{`
                body {
                  padding: 0rem;
                  margin: 0;
                }
                div {
                  border: 2px solid green;
                  padding: 20px; 
                  width: 300px;
                  align-content:center;
                  overflow: auto;
               }

                section {
                  font-size: 5rem;
                  background-color: blue;
                }
              `}</style>


          </body>
      )
  }
}

export default Login
